import styled from 'styled-components';

export const Container = styled.div`
    position: relative;
    max-width: 1000px;
    margin: 0 auto;

    padding: 1rem 1rem;
    display: flex;
    flex-direction: column;
    align-items: center;

    >a{
        position: absolute;
        align-self: flex-start;
        padding: 0rem 0rem;
        left: 0rem;

        font-weight: 800;
        font-size: 1.5rem;
    }


`
